import Vue from 'vue'
import App from './App.vue'
import VueRouter from 'vue-router';

Vue.use(VueRouter);
Vue.config.productionTip = false

const router = new VueRouter({

  routes // 配置路由规则

});


new Vue({
  render: h => h(App),
  el: '#app',

  router, // 注入路由实例

  render: h => h(App) // 渲染根组件
}).$mount('#app')
